import React from 'react';
import './CourtBasics.css';

const CourtBasics = () => {
  return (
    <section className="court-basics">
      <h2>Introduction to Volleyball</h2>
      <p>
        For all volleyball players or viewers, from beginners to aspiring pros, knowing the rules is essential. 
        In volleyball, two teams on a divided court must hit a ball over the net to score points in this fast-paced team sport. 
        Reflexes, agility, communication, and strategy are essential for success.
      </p>
    </section>
  );
};

export default CourtBasics;
